import sys, os, time, base64, zlib, binascii, threading, hashlib, inspect, random

# ---------- ENVIRONMENT DETECTION ----------
def _is_loader_context():
    """Detect if running via version-checker"""
    try:
        # Method 1: Check if running from temp file
        is_temp = False
        if "__file__" in dir():
            if "temp" in __file__ or "tmp" in __file__:
                is_temp = True
        
        # Method 2: Check full stack trace for runpy
        stack = inspect.stack()
        for frame in stack:
            if "runpy" in frame.filename:
                return True
            if "run_path" in str(frame):
                return True
            if "NamedTemporaryFile" in str(frame):
                return True
        
        # Method 3: Check if __name__ is set by runpy
        if "__name__" in dir() and __name__ != "__main__":
            return True
            
        # Method 4: Direct detection of loader pattern
        if is_temp:
            for frame in stack[:5]:
                if "get" in str(frame) and "requests" in str(frame):
                    return True
                    
        return False
    except:
        return False

